import React from 'react';
import {Link, withRouter} from 'react-router-dom';
import './List.css';
import deleteIcon from '../../../images/icons8-trash.svg';

const list = (props) => {
    return (
        <Link to={"/lists/" + props.listId} className="Link">
            <div className = "List">
                <div className = "ListName">{props.list.listName}</div>
                <div className = "ListInfo">{props.list.inprogressTasks.length} tasks left to complete</div>
                <img width="20px" src={deleteIcon} alt="Logo" onClick={() => props.deleteList(props.listId)}/>
            </div>
        </Link>
    )
}

export default withRouter(list);
